Lyft co-founders, CEO 
@logangreen
 and president 
@johnzimmer
 , are stepping down from their roles by mid-April, the company said Wednesday. They will serve as chair and vice chair of Lyft’s board, respectively.
@davidrisherWR
 will take over the CEO position at Lyft.

